import { useState } from "react"

function AddTodoBar() {
  return (
    <>
      <h1>Add an Item</h1>
      <form>
        <input value="Type item here..." type="text"></input>
        <button> Add </button>
      </form>
    </>
  );
}

function ItemRow({ item }) {
  return (
    <tr>
      <td>{item.content}</td>
    </tr>
  );

}

function ListTable({ list }) {
  const rows = [];

  list.forEach((item) => {
    rows.push(
      <ItemRow item={item} />
    )
  }
  )

  return (
    <>
      <table>
        <thead><tr><h2>Todo List</h2></tr></thead>
        <tbody>
          {rows}
        </tbody>
      </table>
    </>
  );
}

export default function App() {
  const [items, setItems] = useState([{ id: 0, content: "example", status: "active" }]);

  return (
    <>
      <AddTodoBar />
      <hr></hr>
      <ListTable list={items} />
    </>
  );
}
